import 'bootstrap/dist/css/bootstrap.css'
import '../scss/global.scss'; 
import { AuthProvider } from "../lib/providers/authProvider"; 
import React from 'react';

const App = ({ Component,pageProps }) => {
  return (
    <> 
      <AuthProvider>
         <Component  {...pageProps} /> 
       </AuthProvider>
    </>
  );
};

export default App;
